import { BrowserRouter, Routes, Route, } from "react-router-dom";

import './App.css';

import HomePage from '../pages/homePage/homePage';
import GamesPage from '../pages/gamesPage/gamesPage';
import SingleGamePage from "../pages/singleGame/singleGamePage";
import UserPage from "../pages/userPage/userPage";
import { useState } from "react";
import SignUpPage from "../pages/signUpPage/signUpPage";

const App = () => {

  const [user, setUser] = useState(false);
  console.log(user)

  return (
    <BrowserRouter>
      <Routes>
          <Route index element={<HomePage user={user}/>} />
          <Route path="/videogames/*" element={<GamesPage />} />
          <Route path="/videogamesAll/*" element={<GamesPage />} />
          <Route path='/videogame/:title' element={<SingleGamePage />} />
          <Route path='/log-in' element={<div>log in</div>} />
          <Route path='/sign-up' element={<SignUpPage setUser={setUser} user={user}/>} />
          <Route path='/watch-list' element={<div>watch-list</div>} />
        <Route path="*" element={<div>wrong url</div>} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
